import React from "react";
import { Form, Icon, Input, Button, Checkbox, notification } from "antd";

import "./RegisterForm.sass"

export default function RegisterForm(){
    return (
        <Form className="register-form">
          <Form.Item
        name="note"
        label="Note"
        rules={[
          {
            required: true,
          },
        ]}
      >
        <Input />
      </Form.Item>   
        </Form>
    )
}
